import React from 'react';

interface QualityWarningModalProps {
  isOpen: boolean;
  onClose: () => void;
  onContinue: () => void;
  qualityIssues: string[];
  lowQualityCount: number;
}

export default function QualityWarningModal({ 
  isOpen, 
  onClose, 
  onContinue, 
  qualityIssues, 
  lowQualityCount 
}: QualityWarningModalProps) {
  if (!isOpen) return null;

  return (
    <div className="fixed inset-0 bg-black/50 backdrop-blur-sm z-50 flex items-center justify-center p-4">
      <div 
        className="max-w-lg mx-auto rounded-2xl shadow-2xl p-6 animate-bounce-in"
        style={{ backgroundColor: 'var(--bg-card)' }}
      >
        {/* Header */}
        <div className="text-center mb-6">
          <div className="text-5xl mb-3">ü§î</div>
          <h2 
            className="text-2xl font-bold mb-2"
            style={{ color: 'var(--text-primary)' }}
          >
            Response Quality Check
          </h2>
          <p 
            className="text-sm"
            style={{ color: 'var(--text-secondary)' }}
          >
            We want to help you provide the best responses
          </p>
        </div>

        {/* Content */}
        <div 
          className="p-4 rounded-xl mb-6"
          style={{ 
            background: 'var(--btn-warning-bg)',
            border: '1px solid #fbbf24'
          }}
        >
          <div className="flex items-start">
            <span className="text-orange-600 mr-3 text-xl">‚ö†Ô∏è</span>
            <div>
              <p 
                className="font-medium mb-2"
                style={{ color: '#92400e' }}
              >
                {lowQualityCount >= 10 
                  ? `We've noticed ${lowQualityCount} responses that could be improved.`
                  : 'Your current response might benefit from more detail.'
                }
              </p>
              
              <p 
                className="text-sm mb-3"
                style={{ color: '#92400e' }}
              >
                Please make sure to check your answers and provide detailed, thoughtful responses about cultural practices in your region.
              </p>

              {qualityIssues.length > 0 && (
                <div className="text-xs" style={{ color: '#92400e' }}>
                  <p className="font-medium mb-1">Issues detected:</p>
                  <ul className="list-disc list-inside space-y-1 ml-2">
                    {qualityIssues.slice(0, 3).map((issue, index) => (
                      <li key={index}>{issue}</li>
                    ))}
                  </ul>
                </div>
              )}
            </div>
          </div>
        </div>

        {/* Tips */}
        <div 
          className="p-4 rounded-xl mb-6"
          style={{ 
            background: 'var(--tag-category-bg)',
            border: '1px solid var(--border-light)'
          }}
        >
          <h3 
            className="font-medium mb-2 text-sm"
            style={{ color: 'var(--text-primary)' }}
          >
            üí° Tips for Better Responses:
          </h3>
          <ul 
            className="text-xs space-y-1"
            style={{ color: 'var(--text-secondary)' }}
          >
            <li>‚Ä¢ Describe specific practices from your region</li>
            <li>‚Ä¢ Include examples when possible</li>
            <li>‚Ä¢ Explain "how" and "why" things are done</li>
            <li>‚Ä¢ Share your personal knowledge and observations</li>
          </ul>
        </div>

        {/* Buttons */}
        <div className="flex space-x-3">
          <button
            onClick={onClose}
            className="flex-1 px-4 py-3 font-medium rounded-xl transition-all duration-200"
            style={{ 
              background: 'var(--btn-secondary-bg)',
              color: 'var(--text-on-dark)'
            }}
          >
            Review My Answer
          </button>
          
          <button
            onClick={onContinue}
            className="flex-1 px-4 py-3 font-medium rounded-xl transition-all duration-200"
            style={{ 
              background: 'var(--btn-warning-bg)',
              color: '#92400e'
            }}
          >
            Continue Anyway
          </button>
        </div>

        {lowQualityCount >= 10 && (
          <div className="mt-4 text-center">
            <p 
              className="text-xs"
              style={{ color: 'var(--text-muted)' }}
            >
              Your participation is valuable! Taking time to provide detailed responses 
              helps preserve cultural knowledge.
            </p>
          </div>
        )}
      </div>
    </div>
  );
}
